import React, { Component } from "react";
import Axios from "axios";

class Maskcall extends Component {
    constructor() {
        super();
        this.state = {
            div4 : null
        }
    }
    async componentDidUpdate() {
        let a = this.props.mylat;
        let b = this.props.mylng;
        const result = await Axios.get('https://8oi9s0nnth.apigw.ntruss.com/corona19-masks/v1/storesByGeo/json', {
            params : {
                lat : a,
                lng : b,
                m : 1000
            }
        })
        if (result.status ===200) {
            console.log(typeof(result.data.stores));
            this.setState({
                div4 : (result.data.stores).map((data,i) => (
                    <tr>
                        <td key = {i}>{i+1}</td>
                        <td>{data.name}</td>
                        <td>{data.addr}</td>
                        <td>{data.lat}</td>
                        <td>{data.lng}</td>
                    </tr>
                ))
            })
        }
        else { console.log(result); console.log('API 서버가 지연되고 있습니다.') }
        
    }
    render() {
        return (
            <>

            </>
        )
    }


}


export default Maskcall;
